import C from './constants';

export function updateUserAuthenticated(status){
    if(status)
        return { type: C.USER_AUTHENTICATED }
    else
        return { type: C.USER_NOT_AUTHENTICATED }
}

export function updateConfig(configInfo) {
    return {
        type: C.UPDATE_CONFIG_INFO,
        payload: configInfo
    }
}
